webpackJsonp([26561827644300],{511:function(t,a){t.exports={data:{site:{siteMetadata:{title:"Zakimoto Site",author:"Kyle Mathews"}},markdownRemark:{id:"/Users/takehanogi11/z-blog/src/pages/個人サイトを変更した/index.md absPath of file >>> MarkdownRemark",html:'<p>卒業の節目に個人サイトを色々変更した。</p>\n<p>以前のサイトはJekyllを使ってた。使っていた理由は昔研究室のHPがそれを使っていたのでそれを真似しただけ。</p>\n<p>今回は<a href="https://www.gatsbyjs.org/">Gatsby</a>という静的サイトジェネレーターを使うことにした。</p>\n<p>きっかけは<a href="https://speakerdeck.com/nnjyami/gatsby-super-fast">このスライド</a>を見たから。爆速サイトにしたかった。実際速い。</p>\n<p>主にReactやらのフロントを以前よりも個人で触る機会も増えたのでサイトの見た目も現在はテンプレのままだけどあとから色々変えていきたい。</p>\n<p>あとブログの方も以前使ってたはてなブログよりここに書いていく方が爆速だし自由そうなのでスターをもらうのも卒業していきたい。はてなのサービスは変わらず好きだけど。</p>\n<p>とりあえずちょいちょいなんか書いていきたいと思います。</p>\n<p>終わり。</p>',frontmatter:{title:"個人サイトを変更した",date:"March 26, 2018"}}},pathContext:{slug:"/個人サイトを変更した/",previous:!1,next:!1}}}});
